import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link, BrowserRouter } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap-icons/font/bootstrap-icons.css';
import RegisterAdmin from './RegisterAdmin';
import LoginComponent from './LoginComponent';
import AdminDashboard from './AdminDashboard';

export function IndexComponent () {
    return (
      <div className="container-fluid">
        <BrowserRouter>
          <header className="bg-danger text-white text-center p-2 mt-2">
            <h2>
              <span className="bi bi-cart4"></span> i-Shop
            </h2>
          </header>
          <div className="mt-2 row">
            <div className="col-3">
              <Link className="btn btn-danger w-100" to="/adminregister">
                Admin Register
              </Link>
            </div>
          </div>
          <Switch>
            <Route path="/adminregister" component={RegisterAdmin} />
            <Route path="/adminlogin" component={LoginComponent} />
            <Route path="/admindashboard" component={AdminDashboard} />
          </Switch>
        </BrowserRouter>
      </div>
    );
  }

export default IndexComponent;
